form.script:
var search_type;
try {
    search_type = localStorage.getItem("search-type");
} catch (e) {
    search_type = 'icons';
}

var search_str = {
    'Icons': 'Iconos',
    'Packs': 'Packs',
};
if (search_type)
{
    document.querySelector(".search-holder .type-selector input[name=search-type][value='"+search_type+"']").checked = true;
    document.querySelector(".search-holder .type-selector .popover-button").innerHTML = search_str[search_type.charAt(0).toUpperCase() + search_type.slice(1)];
}
if (window.location.pathname == '/packs' || window.location.pathname.search('packs-iconos') != -1) {
    document.querySelector(".search-holder .type-selector .popover-button").innerHTML = 'Packs';
    document.querySelector(".search-holder .type-selector input[name=search-type][value='packs']").checked = true;
}

section.script:
var DEFAULT_AVATAR = 'https://image.flaticon.com/img/default_avatar.png';
function set_default_avatar(elem)
{
    elem.src = DEFAULT_AVATAR;
}

var pageview;
try {
    pageview = parseInt(localStorage.pageview || 0, 10)
} catch(e) {
    pageview = 1;
}

if (pageview < 3){
    var login_link = document.getElementById("gr_not-connected");
    login_link.classList.add("dropdown-active");
    try {
        localStorage.pageview = pageview + 1;
    } catch(e) {}

    setTimeout(function() {
        var login_link = document.getElementById("gr_not-connected");
        if (login_link) {
            login_link.classList.remove('dropdown-active');
        }
    }, 4000);
}

