	document.addEventListener('DOMContentLoaded', function(){
        lists = document.querySelectorAll('ul.icons');
        lists.forEach((list) => {
            Functions.hiddenIconsLeftOverFromList(list);
        });
        if (iconLicense == 'CC 3.0 BY') {
            document.getElementById('icon-lincense').classList.remove('hidden');
        }
        document.querySelectorAll("form[name='search-style-form']").forEach(function(element){
            element.addEventListener("submit", function(e){
                e.preventDefault();
                sendSearchForm(e.target.querySelector("#search-style").value);
            });
        });
    });

    function sendSearchForm(word) {
		ga('send', 'event', 'detail-view', 'search-style-bar', word);
		var closeBtn = document.querySelector('form[name="search-style-form"] .remove');
		if (closeBtn !== null) {
			document.getElementById('main-search-style_id').value = document.getElementById('style_id').value;
		}        
        document.querySelector('input[name="word"]').value = word;
        document.querySelector('form[name="search-form"]').submit();
    }

